        function onClick(event, treeId, treeNode){
            if(treeNode.checked == false){
                var treeObj = $.fn.zTree.getZTreeObj(treeId);
                treeNode.checked = true;
                OnCheck(event, treeId, treeNode);
            }
        }

        function beforeRemove(treeId, treeNode) {

            if(treeNode.isDrag == 0){
                $.msg("初始分类是不可以删除的!要想删除,请去分类管理进行删除!", {
                    time: 2000
                });
                return false;
            }
            return true;
        }

        function OnCheck(event, treeId, treeNode){
            if(treeNode.checked){
                var treeObj = $.fn.zTree.getZTreeObj(treeId);
                treeNode.open = true;

                //var update_node = get_insert_nodes(treeNode,treeObj);
                //console.info(update_node);
                //treeObj.updateNode(update_node);
                treeObj.refresh();
            }
        }

        function moveNodes(from,to){

            var moveTreeObj = $.fn.zTree.getZTreeObj(from);
            var moveNodes = moveTreeObj.getCheckedNodes(true);
            if(moveNodes.length <= 0){
                $.msg("请选择要导入的分类!", {
                    time: 1000
                });
                return false;
            }

            var targetTreeObj = $.fn.zTree.getZTreeObj(to);
            var targetNodes = targetTreeObj.getCheckedNodes(true);
            var insert_nodes = null;
            if (targetNodes.length>0) {
                //获取要插入的位置json对像
                insert_nodes = get_insert_nodes(targetNodes[0],targetTreeObj);
                //console.info(targetNodes[0]);
                if(insert_nodes === false){
                    $.msg("三级分类下不可以继续添加子分类!", {
                        time: 2000
                    });
                    return false;
                }
            }

            for(var i in moveNodes){
                var insert_data = targetTreeObj.copyNode(insert_nodes, moveNodes[i], "inner");
                insert_data.checked = false;
                targetTreeObj.removeChildNodes(insert_data);
            }

            moveTreeObj.refresh();
            targetTreeObj.refresh();
        }

        function get_insert_nodes(selectNode,targetTreeObj){
            var targetTreeNodes = targetTreeObj.getNodes();
            var index = targetTreeObj.getNodeIndex(selectNode);
            if(selectNode.level == 0){
                return targetTreeNodes[index];
            }
            else if(selectNode.level == 1){
                var parent_node = selectNode.getParentNode();
                var parent_index = targetTreeObj.getNodeIndex(parent_node);
                return targetTreeNodes[parent_index]['children'][index];
            }
            else{
                return false;
            }
        }


        function getValue(nodes){

            var result = new Array();
            if(nodes.length>0){

                for(var i in nodes){
                    var obj = new Object();
                    obj.id = nodes[i].id;
                    obj.name = nodes[i].name;
                    obj.pId = nodes[i].pId;
                    obj.isDrag = nodes[i].isDrag;
                    obj.level = nodes[i].level;
                    if(typeof(nodes[i].children) != 'undefined'){
                        obj.children = getValue(nodes[i].children);
                    }
                    result.push(obj);
                }
            }
            return result;

        }

        $(document).ready(function(){
            $.fn.zTree.init($("#treeDemo"), setting_check, zNodes);
            $.fn.zTree.init($("#treeDemo2"), setting_radio,zNodes_2);

            $("body").on("click", "#btn_move", function() {

                moveNodes('treeDemo','treeDemo2');
            })


            $("body").on("click", "#btn_submit", function() {
                var treeObj = $.fn.zTree.getZTreeObj("treeDemo2");
                var newnodes = treeObj.getNodesByParam("isDrag",1,null);
                if(newnodes.length<=0){
                    $.msg('没有可保存的分类!', {
                        time: 1000
                    });
                    return;
                }

                var nodes = treeObj.getNodesByParam("pId",null,null);
                //console.info(nodes);
                var data = getValue(nodes);
                //console.info(data);
                $("#btn_submit").attr("disabled",true);
                $.loading.start();
                $.post('/goods/cloud/category-import-ajax', {
                    data: $.toJSON(data)
                }, function(result) {

                    if (result.code == 0) {
                        $.msg(result.message, {
                            time: 3000
                        });
                        $.go(result.go);
                        //tablelist.load();
                    } else {
                        $("#btn_submit").removeAttr("disabled");
                        $.msg(result.message, {
                            time: 5000
                        });
                    }
                }, "JSON");

            })
        });
